DROP VIEW IF EXISTS pivotsource_indicator_ou3;
CREATE VIEW pivotsource_indicator_ou3 AS
        SELECT organisationunit_1.name AS orgunit1,
        organisationunit_1.shortname AS ou1,
        organisationunit_2.name AS orgunit2,
        organisationunit_2.shortname AS ou2,
        organisationunit_3.name AS orgunit3,
        organisationunit_3.shortname AS ou3,
        indicator.name AS indicator,
        indicator.name AS indicatorname,
        indicator.shortname AS indshort,
        substr( period, 0, 5 ) AS year,
        months.name AS month,
        months.name || '-' || substr( period, 3, 2 ) AS period,
        aggregatedindicatorvalue.periodtype,
        ( aggregatedindicatorvalue.factor * aggregatedindicatorvalue.numeratorvalue ) AS numxfactor,
        aggregatedindicatorvalue.denominatorvalue,
        aggregatedindicatorvalue.numeratorvalue,
        _orgunitstructure.level,
        _indicatorgroupsetstructure.*,
        _organisationunitgroupsetstructure.type AS ou_type,
        _organisationunitgroupsetstructure.ownership AS ou_ownership
        FROM indicator indicator, 
        _indicatorgroupsetstructure, 
        _orgunitstructure _orgunitstructure, 
        organisationunit organisationunit_1, 
        organisationunit organisationunit_2, 
        organisationunit organisationunit_3, 
        _organisationunitgroupsetstructure, 
        aggregatedindicatorvalue aggregatedindicatorvalue
        JOIN months
        ON substr( period, 5 ) = months.number
        WHERE indicator.indicatorid = aggregatedindicatorvalue.indicatorid 
        AND
        _indicatorgroupsetstructure.indicatorid = aggregatedindicatorvalue.indicatorid 
        AND
        _orgunitstructure.organisationunitid = aggregatedindicatorvalue.organisationunitid 
        AND
        _orgunitstructure.idlevel1 = organisationunit_1.organisationunitid 
        AND
        _orgunitstructure.idlevel2 = organisationunit_2.organisationunitid 
        AND
        _orgunitstructure.idlevel3 = organisationunit_3.organisationunitid 
        AND
        _organisationunitgroupsetstructure.organisationunitid = aggregatedindicatorvalue.organisationunitid 
        AND
        _orgunitstructure.level = 3 
        AND
        periodtype = 'M'
        ORDER BY period;
        
        
DROP VIEW IF EXISTS pivotsource_routinedata_ou3_all;
